  accession_number:
    title: Accession Number
    description: Accession number assigned by the central lab for the collection timepoint.
    placeholder: Input here
    type: string
  sample_quality_control:
    title: Quality Control
    description: Flag for whether or not sample passed quality control.
    view: radio
    enum:
    - Pass
    - Fail
  host_genome:
    title: Host Genome
    description: Organism used as host in the case of a xenograft sample; required
      if biosample_type = xenograft.
    placeholder: Choose from dropdown
    enum:
    - Canis familiaris
    - Canis lupus
    - Macaca fascicularis
    - Mus musculus
    - Rattus norvegicus
  vendor_sample_id:
    title: Vendor Sample ID
    description: The vendor ID of the sample.
    placeholder: Input here
    type: string
