    title: Collection Date
    description: Date sample is extracted from patient.
    placeholder: yyyy-mm-dd
    format: date
    uiDateFormat: MM-DD-YYYY
    type: string
  sample_submission_date:
    title: Sample Submission Date
    description: Date sample was sent out to the vendor/lab.
    placeholder: yyyy-mm-dd
    format: date
    uiDateFormat: MM-DD-YYYY
    type: string
  extraction_site:
    title: Extraction Site
    description: For sample_type = xenograft, tumor biopsy or microbiome only - it
      is an ontology term describing the most specific  anatomical site from which
      the sample was taken.
    placeholder: Input here
    type: string
  sample_origin:
    title: Sample Origin
    description: 'Describe where sample came from; for example: UK Biobank; or NCT123456.'
    placeholder: Input here
    type: string
  collection_procedure:
    title: Collection Procedure
    description: Describe procedure that was used for sample collection.
    placeholder: Choose from dropdown
    enum:
    - Biopsy
    - Blood draw
    - Bone marrow aspiration
    - Brushing
    - Lavage
    - Lumbar puncture
    - Organ extraction
    - Scraping
    - Surgical resection
    - Vacuum aspiration
