    title: Selection Markers
    description: Markers used for sample purification (FACS). Separate the list with
      commas.
    placeholder: Input here
    type: string
  sample_state:
    title: Sample State
    description: State of the sample.
    placeholder: Choose from dropdown
    enum:
    - NA
    - Flash frozen
    - Frozen
    - FFPE
  is_macrodissected:
    title: Is Macrodissected
    description: Was the specimen macrodissected (YES) or not (NO).
    view: radio
    enum:
    - 'Yes'
    - 'No'
  sample_grouping:
    title: Sample Grouping
    description: Indicate if the sample belongs to a control, or to a replication
      group.
    view: radio
    enum:
    - Control
    - Replicate
